import React from 'react';
import './App.css';
import Checkbox from 'rc-checkbox';
import 'rc-checkbox/assets/index.css';
import { useLocation } from "react-router-dom";
import { useNavigate } from "react-router";

function MDash() {
    const location = useLocation();
    const history = useNavigate();
    const [link, setLink] = useState("");
    useEffect(() => {
        if (location.state) {
          setLink(location.state.link)
        } else {
          history("/signin");
        }
      }, [location.state]);

  return (
    <div className="app">
            <div style={{ display: 'flex', height: '100vh' }}>
                <div style={{ width: '82%', borderRight: '1px solid #ccc' }}>
                    {/* Embed Stripe Express Dashboard using iframe */}
                    <iframe src={link} title="Stripe Express Dashboard" style={{ width: '100%', height: '100%' }} />
                </div>
                <div style={{ width: '18%' }}>
                    {/* Menu strip */}
                    <ul>
                        <li><button onClick={() => history("/dashboard")}>Dashboard</button></li>
                        <li><button onClick={() => history("/rebates")}>Rebates</button></li>
                        <li><button onClick={() => history("/site-builder")}>Site Builder</button></li>
                        <li><button onClick={() => history("/settings")}>Settings</button></li>
                    </ul>
                </div>
            </div>
        </div>
  );
}

export default MDash;
